import React from 'react'
import {IMAGE_BASE_URL,POSTER_SIZE} from '../../config'
import {StyledActor} from '../styles/StyledActor';

const Actor= (actor)=> (
    <StyledActor>
    {actor.name}
        <img src={`${IMAGE_BASE_URL}${POSTER_SIZE}${actor.profile_path}`} />
    </StyledActor>
)

export default Actor;
